  false,\n\t\"url\": null,\n\t\"notes\": \"This is the Reciprocal Fire Protection
  Agreement between the Crane Rangeland Fire Protection Association and the Burns
  Interagency Fire Zone.  The objectives of the agreement are: to enhance the coordination
  and cooperation between the parties named in this agreement; to enhance and maximize
  the safety of all personnel and equipment involved in fire suppression and prescribed
  burning efforts; and to reduce the initial attack time and suppression costs by
  using the \"closest forces concept.\"  Definitions, procedures, command structure,
  communications, liability, appropriation limitations, and cost sharing are all outlined
  in this agreement.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
